package main

import (
	"testing"
)

func TestExtractBase64(t *testing.T) {
	data, err := extractBase64("testdata/input.json", "data.extra_data")
	if err != nil {
		t.Error(err)
	}
	if data != base64Str() {
		t.Fail()
	}
}

func TestCreatePdf(t *testing.T) {
	err := createPdf(base64Str(), "testdata/out.pdf")
	if err != nil {
		t.Error(err)
	}
}

func base64Str() string {
	return ""
}
